import React, { useState } from 'react'
import Hero from './Hero_Section'
import './Header.css'
import Logo from '../../assets/Your paragraph text.png'
import { Link } from 'react-router-dom'
import { IoMenu } from "react-icons/io5";
import indonesiaflag from "..//../assets/flags/indonesia-flag.png"
import australiaflag from "..//../assets/flags/australia.png"
import cambodiaflag from "..//../assets/flags/cambodia.png"
import malaysiaflag from "..//../assets/flags/malaysia.png"
import myanmarflag from "..//../assets/flags/myanmar.png"
import newzealandflag from "..//../assets/flags/NewZealand.png"
import philippinesflag from "..//../assets/flags/Philippines.png"
import singaporeflag from "..//../assets/flags/singapore.png"
import thailandflag from "..//../assets/flags/thailandflag.png"
import vietnamflag from "..//../assets/flags/vietnam.png"
import { useTranslation } from 'react-i18next'
import i18n from '../../i18n'

const Header = ({setShowlogin}) => {
  const [mobileItem, setMobileItem] = useState(false)
  const Clicked = () => {
    setMobileItem(!mobileItem)

  }
   const{t,i18n} =useTranslation();
   const changeLanguage= (lng)=>{
    i18n.changeLanguage(lng)
   }

   const [isOpen, setIsOpen] = useState(false);
   const [selectedOption, setSelectedOption] = useState({
    value: "en",
    label: "English",
    image: "data:image/png;base64,",
  });
 
   const options = [
     {
       value: "en",
       label: "English",
       image: "data:image/png;base64,",
     },
     {
       value: "id",
       label: "Bahasa",
       image: "data:image/png;base64,",
     },
    
     {
      value: "th",
      label:  " Thai",
      image: "data:image/png;base64,",
    },
    {
      value: "vi",
      label: "Vietnamese",
      image: "data:image/png;base64,",
    },
    {
      value: "ms",
      label: "Malay ",
      image: "data:image/png;base64,",
    },
    {
      value: "fil",
      label: "Filipino",
      image: "data:image/jpeg;base64,",
    },
    {
      value: "my",
      label: "Burmese",
      image: "data:image/png;base64,",
    },
    {
      value: "km",
      label: "Khmer ",
      image: "data:image/png;base64,",
    },
   ];
   const toggleDropdown = () => setIsOpen(!isOpen);

  const handleOptionClick = (option) => {
    setSelectedOption(option);
    setIsOpen(false);
  };
  return (
    <>
    
      <div className='nav'>
        <div className='navbar'>
          <div className="nav-left-logo">
            <Link to='/'>
              <img src={Logo} alt="" />
            </Link>
          </div>
          <div className={mobileItem ? 'mobile-item mobile-items ' : ' nav-center-item'}>
            <ul className=' dropdown mobile-items' >
              <li className="dropbtn"><Link to='/'>{t("label1")}</Link></li>

              <li><Link to="/businesspay">{t("label2")}</Link></li>
              <li><Link to="/about">{t("label3")}</Link></li>
              <li><Link to="/careers">{t("label4")}</Link></li>
              <li><Link to="/contact">{t("label5")}</Link></li>
            </ul>
          </div>

           

          <div className="nav-right-item">
          <div style={styles.container}>
             <div
        style={styles.dropdownHeader}
        onClick={toggleDropdown}
      >
        <img
          src={selectedOption.image}
          alt={selectedOption.label}
          style={styles.image}
        />
        <span>{selectedOption.label}</span>
      </div>
      {isOpen && (
        <div className="custom-scrollbar" style={styles.dropdownList}>
          {options.map((option) => (
            <div 
            
              key={option.value}
              style={styles.dropdownItem}
              onClick={(e) => {
                handleOptionClick(option); 
                changeLanguage(option.value); 
              }}
            >
              <img
                src={option.image}
                alt={option.label}
                style={styles.image}
              />
              <span>{option.label}</span>
            </div>
          ))}
        </div>
      )}
    </div>
            <div className='btn'>
              <button onClick={()=>setShowlogin(true)} >{t("button_text")}</button>
            </div>
            <IoMenu onClick={Clicked} className='menu' />
          </div>
        </div>
      </div>

    </>
  )
}

const styles = {
  container: {
    width: "120px",
    position: "relative",
    display:"flex",
    justifyContent: "start",
    fontFamily: "Arial, sans-serif",
  },
  dropdownHeader: {
    display: "flex",
    color:'white',
    alignItems: "center",
    justifyContent: "space-between",
    padding: "10px",
    cursor: "pointer",
    backgroundColor: "none",
  },
  dropdownList: {
    position: "absolute",
    top: "100%",
    left: "0",
    right: "0",
    border:"1px solid #0a2822",
    borderRadius: "5px",
    backgroundColor: "#54725D",
    zIndex: "2000",
    maxHeight: "150px",
    width:"150px",
    overflowY: "scroll",
  },
  dropdownItem: {
    display: "flex",
    alignItems: "center",
    padding: "10px",
    cursor: "pointer",
  },
  image: {
    marginRight: "5px",
    width: "23px",
    height: "23px",
    objectFit: "cover",
    borderRadius:"50%"
  },
};

export default Header
